import React from 'react';
import './App.css';
import root from './index.js';

function exit() {
    document.cookie = "jwt=" + " " + ";max-age=0";
    root.render(<App />)
}

function Profile() {
    return (
        <div className="Profile">
            <p>Ваш профиль</p>
            <p>Поиск людей</p>
            <p>Друзья</p>
            <p>Чаты</p>
            <p onClick={exit} >Выйти</p>
        </div>
    );
}

export default function setProfile() {
    root.render(<Profile />)
}
